import React from 'react'
import {Link, Router} from 'react-router-dom'

function NavBar(){
    return(
        <Router>
        <ul>
            <li><Link to="/home">Home</Link></li>
            <li><Link to="/login">Login</Link></li>
        </ul>
        </Router>
    )
}

export default NavBar;
